function CSV_generateItem.GetValue(index, key)
	index = tostring(index)
	key = tostring(key)
    if generateItem[index] == nil then
        ZLog.Logger("Excel :generateItem  :".. index .." key:".. key.."!")
        return nil
    end
    if generateItem[index][key] == nil then
        ZLog.Logger("Excel : generateItem  :".. index .." key:".. key.."!")
        return nil
    end

    return generateItem[index][key]
end

function CSV_generateItem.GetAllKeys()
    local keys = {}
    for k in pairs(generateItem) do
        keys[#keys + 1] = k
    end
    if #keys == 0 then
        ZLog.Logger(string.format("Excel : "))
        return nil
    end
    return keys
end